import React from 'react';
import Practice from './Practice';
import Sdata from './Sdata';

const All = () => {
    return (
        <div>
         { Sdata.map((val) =>{
              
              return(
               <Practice 
               key={val.id}
               images={val.images}
               name={val.name}
               links={val.links}
               title={val.title}
               
                />   
              )
         })
         
         }
        </div>

        
    )
}

export default All
